import React from "react";
import Head from "./Head";
import Text from "./Text";
import Social from "./Social";
import Team from "./Card";

function App() {
  return (
    <div className="container">
      <Head />
      <Text />
      <Social />
      <Team />
    </div>
  );
}

export default App;
